CREATE DEFINER=`root`@`localhost` PROCEDURE `Asignaeess`(
    IN p_idcentro_poblado INT,
    IN p_fk_ideess INT,
    IN p_idusu INT
)
BEGIN
    DECLARE v_count INT;
    DECLARE v_last_id INT;
    DECLARE v_nom_dist_eess VARCHAR(255);
    DECLARE v_nom_dist_cp VARCHAR(255);
    DECLARE v_continue INT DEFAULT 1;

    -- Obtener nom_dist de eess
    SELECT d.nom_dist
    INTO v_nom_dist_eess
    FROM eess e
    JOIN distrito d ON e.fk_iddistrito = d.iddistrito
    WHERE e.ideess = p_fk_ideess;

    -- Obtener nom_dist de centro_poblado
    SELECT d.nom_dist
    INTO v_nom_dist_cp
    FROM centro_poblado cp
    JOIN distrito d ON cp.fk_iddistrito = d.iddistrito
    WHERE cp.idcentro_poblado = p_idcentro_poblado;

    -- Verificar si los distritos coinciden
    IF v_nom_dist_eess != v_nom_dist_cp THEN
        SET v_continue = 0;
        SELECT 'El distrito del establecimiento de salud no coincide con el distrito del centro poblado. Por favor, elija otro distrito.' AS mensaje;
    END IF;

    IF v_continue = 1 THEN
        -- Contar cuántos eess están asociados con el centro_poblado
        SELECT COUNT(*)
        INTO v_count
        FROM eessxcp
        WHERE fk_idcentro_poblado = p_idcentro_poblado;

        -- Verificar si ya tiene 2 asociaciones
        IF v_count >= 2 THEN
            SELECT 'Un centro poblado no puede estar asociado a más de 2 establecimientos de salud' AS mensaje;
        ELSE
            -- Insertar la asociación si tiene menos de 2
            INSERT INTO eessxcp (fk_ideess, fk_idcentro_poblado)
            VALUES (p_fk_ideess, p_idcentro_poblado);

            -- Obtener el último id insertado en eessxcp
            SELECT LAST_INSERT_ID() INTO v_last_id;

            -- Insertar en la tabla asigusu
            INSERT INTO asigusu (fk_idasignado, fk_idusu)
            VALUES (v_last_id, p_idusu);

            -- Si ya tiene 1 asociación, mostrar un mensaje
            IF v_count = 1 THEN
                SELECT 'Este centro poblado ya tiene un establecimiento de salud asignado' AS mensaje;
            ELSE
                -- Mensaje de éxito al insertar la primera asociación
                SELECT 'Establecimiento de salud asignado correctamente al centro poblado' AS mensaje;
            END IF;
        END IF;
    END IF;
END ;;
DELIMITER ;
