CREATE DEFINER=`root`@`localhost` PROCEDURE `p_quitarasigna`(
    IN p_id INT
)
BEGIN
    -- Eliminar las filas dependientes en la tabla asigusu
    DELETE FROM asigusu
    WHERE fk_idasignado = p_id;
    
    -- Eliminar la fila en la tabla eessxcp
    DELETE FROM eessxcp
    WHERE idasigna = p_id;
    
    -- Mensaje de éxito
    SELECT 'Asignación del establecimiento quitada correctamente.' AS mensaje;
END ;;
